import React from "react";
import ContentItem from "./ContentItem";
function Content(){

    return(
     <div >
            <p>React is a js library for building user interface.
                Flutter is a framework for mobile application.
            </p>
            <ul className="list-group">
                <ContentItem name="COMPONENT" id="component"/>
                <ContentItem name="JSX" id="jsx"/>
                <ContentItem name="VIRTUAL DOM" id="virtual dom"/>
             
            </ul>
     </div>
    );
}
export default Content;
